package com.xingyun.easypayapi.config;

import cn.hutool.core.util.RandomUtil;
import cn.hutool.crypto.digest.DigestUtil;
import com.alibaba.fastjson2.JSON;
import com.alibaba.fastjson2.JSONObject;
import com.xingyun.easypayapi.common.IpUtil;
import com.xingyun.easypaycommon.base.R;
import com.xingyun.easypaycommon.base.ResultCode;
import org.apache.commons.lang3.StringUtils;
import org.slf4j.Logger;
import org.slf4j.LoggerFactory;
import org.springframework.web.bind.annotation.RequestMethod;

import javax.servlet.*;
import javax.servlet.http.HttpServletRequest;
import javax.servlet.http.HttpServletResponse;
import java.io.IOException;
import java.util.Enumeration;
import java.util.Locale;

public class RequestFilter implements Filter {

    private static final Logger logger = LoggerFactory.getLogger("RequestFilter");

    private static final String X_WWW_FORM_URL_ENCODE = "application/x-www-form-urlencoded";


    @Override
    public void doFilter(ServletRequest request, ServletResponse response, FilterChain filterChain) throws IOException, ServletException {

        doMyFilter((HttpServletRequest) request, (HttpServletResponse) response, filterChain);
        //filterChain.doFilter(request, response);

    }

    /**
     * 打印请求参数
     *
     * @param req
     * @param res
     * @param chain
     * @throws ServletException
     * @throws IOException
     */
    private void doMyFilter(HttpServletRequest req, HttpServletResponse res, FilterChain chain) throws ServletException, IOException {

        if (RequestMethod.OPTIONS.toString().equals(req.getMethod())) {
            res.setHeader("Access-Control-Allow-Origin", "*");
            res.setHeader("Access-Control-Allow-Methods", "*");
            res.setHeader("Access-Control-Allow-Headers", "*");
            return;
        }

        String requestURI = req.getRequestURI();
        if ("/common/h5".equals(requestURI)
            || "/common/appDownloadUrl".equals(requestURI)
            || "/member/chat".equals(requestURI)){
            chain.doFilter(req, res);
            return;
        }
        if (requestURI.startsWith("/pay/callback")){
            chain.doFilter(req, res);
            return;
        }
        if ("/doc.html".equals(requestURI)
            || requestURI.startsWith("/webjars/")
            || "/swagger-resources".equals(requestURI)
            || "/v2/api-docs".equals(requestURI)){
            chain.doFilter(req, res);
            return;
        }
        boolean signVerify = this.verifySign(req);
        if (!signVerify){
            //String ipAddress = IpUtil.getIpAddress(req);
            //logger.error("请求异常签名:{}",ipAddress);
            res.getWriter().write(MONEY);
            return;
        }

        if (StringUtils.isNotBlank(req.getContentType()) && req.getContentType().contains("multipart/form-data")) {
            logger.info("[{}] {} ", req.getMethod(), requestURI);
            chain.doFilter(req, res);
            return;
        }

        if (RequestMethod.GET.toString().equals(req.getMethod())) {
            //空请求太多 影响日志查看
            if (!"/".equals(requestURI)) {
                logger.info("[{}] [{}] {} ,g param is : {}", req.getMethod(), req.getContentType(), requestURI, JSONObject.toJSONString(req.getParameterMap()));
            }

            chain.doFilter(req, res);
            return;
        }
        if (req.getContentType().toLowerCase(Locale.ROOT).startsWith(X_WWW_FORM_URL_ENCODE)) {
            Enumeration<String> parameterNames = req.getParameterNames();
            StringBuffer sb = new StringBuffer();
            while (parameterNames.hasMoreElements()) {
                String element = parameterNames.nextElement();
                sb.append(element).append("=");
                String parameter = req.getParameter(element);
                sb.append(parameter).append("&");
            }
            logger.info("[{}] [{}] {} ,x param is : {}", req.getMethod(), req.getContentType(), requestURI, sb);
            chain.doFilter(req, res);
            return;
        }
        String body = HttpHelper.getBodyString(req);
        if (StringUtils.isNotBlank(body)) {
            logger.info("[{}] [{}] {} ,p param is : {}", req.getMethod(), req.getContentType(), requestURI, body);
            HttpServletRequest request = new BodyReaderHttpServletRequestWrapper(req, body);
            chain.doFilter(request, res);
            return;
        }
        chain.doFilter(req, res);

    }

    private boolean verifySign(HttpServletRequest req){
        String timestamp = req.getHeader("timestamp");

        String device_id = req.getHeader("device-id");

        String sign = req.getHeader("x-xy-sg");

        //logger.error("timestamp{},device_id:{},sign:{}",timestamp,device_id,sign);

        if (StringUtils.isBlank(timestamp)
                || StringUtils.isBlank(device_id)
                || StringUtils.isBlank(sign)){
            return false;
        }

        long passed = System.currentTimeMillis() - Long.parseLong(timestamp);

        if (passed > 5000){
            String ipAddress = IpUtil.getIpAddress(req);
            logger.error("签名超时:{},{}",ipAddress,req.getRequestURI());
            return false;
        }

        if (StringUtils.isBlank(device_id) || StringUtils.isBlank(device_id)){
            return false;
        }

        String sign2 = DigestUtil.md5Hex(device_id + timestamp + "xy28");

        return sign2.equals(sign);

    }

    public static void main(String[] args) {
        System.out.println(MONEY.length());
    }


    private static final String MONEY = "";

}
